	public static int stressInference(double[] feature){
		double s = gmm(feature, stressMu, stressSigma,stressWeight);
		double n = gmm(feature, neutralMu, neutralSigma,neutralWeight);
		//Log.e(TAG, "inference: " + s + " " + n);
		if (s > n) return 1;
		else return 0;
	}
	
	// pdf function of diagnal multivaluate gaussian, the output is log probability.
	static double gaussian(double[] data, double[] mean, double[] sigma) {
		// data - feature vector
		// mean - mean
		// sigma - diag of the cov matrix
		final int DIM = data.length;
		double[] invs = new double[DIM];
		double[] temp = new double[DIM];
		double[] x = new double[DIM];
		double result = 0;
		double log_det = 0;
		for (int i = 0; i < DIM; i++) {
			invs[i] = 1/sigma[i];
			//printf("%f , %f\n",log_det,sigma[i]);
			log_det += Math.log(sigma[i]);
		}
		for (int i = 0; i < DIM; i++)
		{x[i] = data[i] - mean[i];}
		
		for (int i=0; i < DIM; i++) {
			temp[i] = 0;
			temp[i] = x[i]*invs[i];
		}
		
		for (int i = 0; i < DIM; i++)
			result += temp[i]*x[i];
		//printf("result:%f\n",result);
		result = (-0.5*result);
		result -= Math.log(Math.pow((2*PI), DIM/2.0))+log_det/2;
		return result;
	}

	// log probability of the gmm.
	static double gmm(double[] x, double mean[][], double sigma[][], double weights[]){
		double pr = 0;
		double tmp = 0;
		for(int i = 0;i<NCOM;i++){
			tmp = gaussian(x, mean[i], sigma[i]);
			//printf("----------# %f #----------\n",tmp);
			pr += Math.exp(tmp)*weights[i]; 
		}
		return Math.log(pr);
	}


